import React from 'react'
import { View, Text,StatusBar } from 'react-native'

const HomeScreen = () => {
    return (
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
          <StatusBar barStyle="light"/>
          <Text>Home!</Text>
        </View>
      );
    }

export default HomeScreen
